import React from 'react'
import { View, Text, StyleSheet } from 'react-native'
import Sidebar from './Sidebar'

export default function Navbar() {
    return (
        <View style={styles.navbar}>
            <Sidebar />
        </View>
    )
}


const styles = StyleSheet.create({
    navbar: {
        backgroundColor: "#000",
        width: "100%",
        height: 60
    },
})
